(2, 6, 'Launch', 'Linus building', 'Linus Building, Chiran Fort Lane, Patigadda, Begumpet, Hyderabad, Andhra Pradesh 500003, India', 0, 1, '2013-11-06 10:26:00', '2013-11-07 09:26:00', 0, 0, 0, '', 'logo_a0f67f8015_1371900522_521843900_1-Pictures-of--birthday-party-decorationswedding-decorationsreception-set-designscorporate-events.jpg', '<h1>&nbsp;</h1>\r\n\r\n<h1><span style="font-size:14px"><strong>INDUCO SOLUTIONS&nbsp;</strong>has engaged Corporates big and small in being able to meet their diverse needs on business solutions. A snapshot of a few</span></h1>\r\n\r\n<p><strong>Web Development:</strong></p>\r\n\r\n<p>Web development refers to the job involved in creating and developing a web site for the Internet (World Wide Web) or an intranet (a private network). This includes designing the website, website content management, client liaison, client-side/server-side scripting, hosting website server and network security configuration, and e-commerce development. However, among web professionals, &ldquo;web development&rdquo; usually refers to the main non-design aspects of building web sites: writing markup and coding. Web development can range from creating the simplest static single web page of plain text to the complex web-based internet websites or applications, electronic businesses, or social network services.</p>\r\n\r\n<p>We specialize in creating websites, CRM, ERP or any other web based application both static and dynamic based up on our clients requirement.</p>\r\n\r\n<p>Quality is the key for any website to get visits on the internet.&nbsp; We give you more reasons to create a website for your business along with different ways to get visitors which in turn increases the revenue for your website.</p>\r\n\r\n<p>Our Software Development Team is proficient in Dot Net, PHP and Perl application building. Software Exposure which is a major milestone in INDUCO SOLUTIONS lifecycle.</p>\r\n\r\n<p>USAGE of CMS like WordPress, Joomla, Drupal, Zen Cart, Open Cart, Magento, Boonex and several others help us to give more prompt websites to our customers to which customization can be added by our core-php team to meet clients requirements.</p>\r\n', 'Induco Solutions Pvt Ltd', '<p><strong>We help clients deliver innovation to their customers: And we measure our success by our client&rsquo;s success.</strong></p>\r\n\r\n<p>We create, design, develop, deploy and assure. We establish strong relationships with our clients, whether we&rsquo;re taking on specific projects, help them reach their business goal, implement the best innovation in the market that suits our clients business. At every level, we do what it takes to turn your ideas into value for your customers.</p>\r\n\r\n<p>Who We Serve:</p>\r\n\r\n<p>We work with both start-ups clients and techno giants to build work on their new projects or to enhance their existing projects. We have expertise in a broad range of industries including enterprise technology, finance, educational, telecommunications, digital media, e-commerce and medical applications. We have already serviced several hundreds of clients across the United States of America, United Kingdom, Australia, India, Middle East Asia, Singapore and several other countries.<br />\r\nHow We&rsquo;re Different: Innovation by Design</p>\r\n\r\n<p>We believe in team work and always depend on our core team to meet client requirements. We always had a very good feedback for the team from the clients we serviced so far. Mastering technology was a major key which helped us in servicing our clients globally.</p>\r\n\r\n<p>The end product for all the projects we handled so far was &ldquo;innovation&rdquo; as a designed outcome, This is what Induco Solutions strives to do everyday.</p>\r\n\r\n<p>We work with you to find and identify the key points, making the connections that create a difference for your products.</p>\r\n\r\n<p>By providing an innovative and unparalleled range of design and technology expertise, we enable you to stay ahead of the competition by delivering world class products to you at rapid pace.</p>\r\n', 1, 1, 'Induco-Solutions/107901669258673?ref=hl', 0, 'praveentalla', 0, NULL, NULL, 0, '', 4, 67, 1, 'induco', 200, 1, '2013-10-24 10:33:01', '2013-10-24 11:12:02', 5, 0, 2, 0, NULL, 0, 1, 0, NULL, 0, 0, NULL, 19, 1, NULL),
