INSERT INTO `pages` (`id`, `parent_id`, `pages_title`, `description`, `active`, `page_type`, `footer_bar`, `header_bar`, `external_link`, `slug`, `plan`, `using`, `popular`, `about`, `created_at`, `updated_at`) VALUES
(1, 0, 'Conferences', '<p><span>Survey your attendees'' day-of-event preferences, such as a class or workshop selection. Request their job title, website, or any other custom field to better understand your audience.s<span>ocial media empowers event organizers to reach their audience at little cost and enables event attendees to market your event for you. Get Eventbrite''s free britepaper and learn how to leverage the power of social media!</span></span></p>', 1, 'plan', 'YES', 'YES', NULL, 'conferences', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:17:19'),
(2, 0, 'Sell ticket Online', '<div class="partner-info">\r\n<h2>1.</h2>\r\n<p>To get started, first&nbsp;sign up&nbsp;for a free Eventbriteclone account or&nbsp;log in&nbsp;to your existing Eventbrite account and&nbsp;create an event, which can take as little as three minutes!</p>\r\n</div>\r\n<div class="partner-info">\r\n<h2>2.</h2>\r\n<p>When creating your event page, you''ll create at least one&nbsp;ticket type.&nbsp;<br />Once you''ve created your event page, you can also easily creatediscount and/or access codes&nbsp;for your ticket types, which allows you to offer discounts or password-protected ticket types to different people.</p>\r\n</div>\r\n<div class="partner-info">\r\n<h2>3.</h2>\r\n<p>After creating your ticket type and publishing your event, your attendees will be able to&nbsp;easily register&nbsp;for your event online.&nbsp;</p>\r\n</div>', 1, 'using', 'YES', 'YES', NULL, 'sell', 0, 1, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:29:26'),
(3, 0, 'Mobile App', '<h3>Eventshack for mobile</h3>\r\n\r\n<h4>Discover local events and access your Eventshack tickets and event information.</h4>\r\n\r\n<h3>Check your friends&#39; events</h3>\r\n\r\n<h4>Connect with Facebook to see events your friends are going to.</h4>\r\n\r\n<h3>one place</h3>\r\n\r\n<h4>View your upcoming events, tickets, and event information.</h4>\r\n\r\n<h3>Add to Passbook</h3>\r\n\r\n<h4>Access your Eventshack tickets in Passbook on your iPhone or iPod Touch.</h4>\r\n', 1, 'popular', 'YES', 'YES', NULL, 'mobile', 0, 1, 1, 0, '2013-04-16 00:02:43', '2013-10-24 13:47:59'),
(4, 0, 'About Us', '<p>we believe that gathering with others is the best way for people to learn, grow, get inspired, feel connected, get healthy, give back, and celebrate. So we''re building technology that facilitates those gatherings, by helping people find and attend events that feed their interests, while connecting them with others who share their passions.</p>\r\n<p>We are here to bring people together.</p>', 1, 'about', 'YES', 'YES', NULL, 'about', 0, 0, 0, 1, '2013-04-16 00:02:43', '2013-05-03 11:42:31'),
(5, 0, 'Politics', '<p><span>Campaign and political event organizers are making their lives easier&nbsp;</span><span>by using Eventbrite to manage their events and bring people&nbsp;</span><span>together.</span></p>\r\n<p><span><span>From debates, to fundraising dinners, to conventions and town halls, chances are you''ve been to or hosted a political event. Eventbrite is a ticketing and event registration platform that makes managing events and organizing your fundraisers easy.&nbsp;</span></span></p>\r\n<ul>\r\n<li>Customize to match your website</li>\r\n<li>Send email invitations</li>\r\n<li>Collect credit card payments</li>\r\n</ul>\r\n<p><span><span>so&nbsp;<span>start collecting more donations today by selecting Eventbriteclone for your next political event!</span></span></span></p>', 0, 'plan', 'YES', 'YES', NULL, 'politics', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:19:47'),
(6, 0, 'Endurance Sports', '<p><span>Eventbriteclone offers an effective race registration solution to maximize participation and reach for your endurance events&mdash;both large and small. We offer customizable features, and powerful marketing and social media tools to help acquire new athletes, volunteers and fans. Race organizers can also benefit from anytime access to valuable sales and registration reports, and use of our mobile registration solutions for seamless onsite check-in and race entry.eventbriteclone is also endurance sport.</span></p>', 1, 'plan', 'YES', 'YES', NULL, 'endurance_ports', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:20:38'),
(7, 0, 'Music Festivals', NULL, 1, 'plan', 'YES', 'YES', NULL, 'music_festivals', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-04-16 00:02:43'),
(8, 0, 'Community Events', '<p>you''re already an event organizer. From community events, to school fundraisers,to&nbsp;PTO meetings.&nbsp;you''re volunteering to help send out event information.</p>\r\n<p>Eventbriteclone is a ticketing platform that makes managing events and organizing fundraisers easy. &nbsp;Creating an event page is fast, and Eventbriteclone will store all of your contact lists so you don''t have to fuss with keeping the sports boosters separate from the troop mothers.It''s flexible enough that you can use it for all the events you work on - big or small.</p>', 1, 'plan', 'YES', 'YES', NULL, 'community_events', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:22:57'),
(9, 0, 'Classes', '<p><span>Whether you love to teach or just want to earn extra money, Eventbriteclone provides you with the tools to have a successful class. From customized webpages to social media promotion and real-time registration tracking, we take care of the hard stuff, so you can focus on teaching and sharing your passion.</span></p>', 1, 'plan', 'YES', 'YES', NULL, 'classes', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-03 11:16:45'),
(10, 0, 'Fundraisers & NPO', '<p><span>Events are a great way to raise money and awareness for a cause. Eventbrite provides nonprofits with affordable, easy-to-use online tools that enable you to run successful events.</span></p>\r\n<h2>Features</h2>\r\n<ul style="list-style-type: circle;">\r\n<li>Collect custom data about your attendees</li>\r\n<li>Reach new volunteers through social media integration</li>\r\n<li>24/7 customer service and support</li>\r\n<li>Collect donations on-site through At The Door</li>\r\n</ul>', 1, 'plan', 'YES', 'YES', NULL, 'npo', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-03 11:20:24'),
(11, 0, 'Food & Wine Events', '<h4>Easy, reliable online ticketing with built-in promotional tools to bring more food and wine lovers to your event.</h4>\r\n<h3>Leverage Social&nbsp;Media Promotion</h3>\r\n<p>Attendees can promote your event to their friends through our seamless integration with Facebook, Twitter, and LinkedIn.</p>\r\n<h3>Gain More Insights with&nbsp;Detailed Reports</h3>\r\n<p>Understand where your ticket sales are coming from - by day, geography, and marketing campaigns.</p>', 1, 'plan', 'YES', 'YES', NULL, 'food', 1, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:27:21'),
(12, 0, 'Event Registration', '<p><span>the first steps in setting up online registration for your event is to create a free&nbsp;</span>ticket type<span>. (If you''re collecting registrations rather than selling tickets, you can&nbsp;</span>change the terminology<span>&nbsp;on your event page to reflect this!</span></p>\r\n<p>you''ve created your ticket type and published your event, your attendes will be able to&nbsp;easily register&nbsp;for your event online.</p>\r\n<div class="partner-info">\r\n<h2>1.</h2>\r\n<p>sign up&nbsp;for a free Eventbriteclone account or&nbsp;log in&nbsp;to your existing Eventbriteclone account and&nbsp;create an event.</p>\r\n</div>\r\n<div class="partner-info">\r\n<h2>2.</h2>\r\n<p>your event is free, one of the first steps in setting up online registration for your event is to create a free&nbsp;ticket type.&nbsp;</p>\r\n</div>\r\n<div class="partner-info">\r\n<h2>3.</h2>\r\n<p>Once you''ve created your ticket type and published your event, your attendees will be able to&nbsp;easily register&nbsp;for your event online.&nbsp;</p>\r\n<br />\r\n<p>&nbsp;</p>\r\n</div>', 1, 'using', 'YES', 'YES', NULL, 'free', 0, 1, 1, 0, '2013-04-16 00:02:43', '2013-07-08 12:17:22'),
(13, 0, 'Quick Start Guides', NULL, 1, 'using', 'YES', 'YES', NULL, 'quick_start', 0, 1, 0, 0, '2013-04-16 00:02:43', '2013-04-16 00:02:43'),
(14, 0, 'Help Center', '<p>From sample pages to FAQ&#39;s for beginners, here&#39;s what you need to get started. Remember, Eventshack is free&nbsp;to use if your event is free, so go ahead and create a test event page to give things a try!</p>\r\n\r\n<h3>Customize event page</h3>\r\n\r\n<ul>\r\n	<li>Images for event page</li>\r\n	<li>Privacy settings for event</li>\r\n	<li>Copy an event page</li>\r\n	<li>Custom URL/web address for event page</li>\r\n	<li>&quot;Registration&quot; vs. &quot;ticketing&quot; terminology</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 'using', 'YES', 'YES', NULL, 'help', 0, 1, 0, 0, '2013-04-16 00:02:43', '2013-10-24 13:45:50'),
(15, 0, 'Pricing', '<p><span>The &nbsp;charges $150 per ticket for their annual charity. They use Eventbriteclone''s credit card processor to collect the money which costs $5.50 per ticket and Eventbriteclone''s Service Fee is $5.74 per ticket. The chooses to pay for both fees, so they will receive $140.76 per ticket sold from Eventbriteclone after their event.</span></p>\r\n<h4>Eventbrite Service Fee</h4>\r\n<p>For every ticket you sell using Eventbrite, we charge 2.5% of the ticket value plus $0.99 per ticket. No matter how much you charge, we cap our service fee at $9.95 per ticket for event organizers.</p>\r\n<h4>Credit Card Processing Fee</h4>\r\n<p>When you collect money through Eventbriteclone''s standard credit card processing, we charge 3% of the ticket value.</p>\r\n<ul>\r\n<li>All major credit cards accepted<img id="cc_standard" src="http://ebmedia.eventbrite.com/s3-build/14251-rc2013-04-29-b973944//django/images/pages/fees/payments_cc_standard-trans.png" alt="All major credit cards accepted" /></li>\r\n<li>Fast, easy, no cost to set up</li>\r\n<li>PCI compliant</li>\r\n<li>Quickest and easiest experience for your attendees</li>\r\n</ul>\r\n<p><span><br /></span></p>', 1, 'using', 'YES', NULL, NULL, 'pricing', 0, 1, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:37:23'),
(16, 0, 'Referral Program', '<h3>Step 1. Refer your friends</h3>\r\n<p>Eventbriteclone''s feature set and flexibility make it a great solution for all types of events - from small reunions to large conferences. As an Eventbriteclone Referrer, this gives you the opportunity to promote Eventbriteclone as either a broad solution or targeted to any of a number of verticals.</p>\r\n<h3>Step 2. sell tickets</h3>\r\n<p>Eventbriteclone is very easy to use and extremely powerful. People who use Eventbriteclone absolutely love it. this means superb conversion and retention rates. Eventbriteclone is free to try and test, so there is zero barrier for your referrals to sign up and have a look around.</p>\r\n<h3>Step 3. We pay you!</h3>\r\n<p>Eventbriteclone''s referral program offers a very generous referral payment for a full year following your referred user''s signup as an Eventbriteclone organizer.</p>', 1, 'using', 'YES', NULL, NULL, 'ref', 0, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:40:06'),
(18, 0, 'At The Door', '', 1, 'using', 'YES', NULL, NULL, 'at_the_door', 0, 1, 0, 0, '2013-04-16 00:02:43', '2013-07-08 12:19:45'),
(21, 0, 'Online Event Registration', '<div id="hero_promo">\r\n<h2>If it&#39;s happening out there you&#39;ll find it here.</h2>\r\n\r\n<h3>Browse 1000s of events. Or create your own events and sell tickets right here.</h3>\r\n</div>\r\n', 1, 'popular', 'YES', NULL, '', 'online', 0, 0, 1, 0, '2013-04-16 00:02:43', '2013-10-24 13:51:34'),
(22, 0, 'Event Management', '<h1>Simple, Powerful Online Event Management</h1>\r\n<ul>\r\n<li>Set up an event page and start promoting in minutes</li>\r\n<li>Sell tickets, collect money, and track sales</li>\r\n<li>Manage attendee check-ins and much more</li>\r\n</ul>\r\n<h2>Post your event</h2>\r\n<ul>\r\n<li>Create a professional looking event page and customize it with colors, logos, images, and a personalized URL.</li>\r\n<li>Specify different ticket types, discount codes, and send attendees professional barcoded tickets.</li>\r\n<li>Sell tickets and collect registrations directly from your own organization&rsquo;s Website by embedding our ticket widget.</li>\r\n</ul>\r\n<h2>Spread the word</h2>\r\n<ul>\r\n<li>Automatically get your event listed with Google and other search engines as well as event listing sites to help attendees discover your event.</li>\r\n<li>Let attendees help spread the word through one-click integration with Facebook, Twitter and many more social media platforms.</li>\r\n<li>Send customized email invites and schedule email communications with attendees. We also integrate with MailChimp.</li>\r\n</ul>\r\n<h2>Collect</h2>\r\n<ul>\r\n<li>Access funds immediately when you let attendees pay through PayPal or Google Checkout.</li>\r\n<li>Sell different levels of admission prices for a single event. Create time sensitive &ldquo;Early Bird&rdquo; or limited availability &ldquo;Special Offer&rdquo; tickets.</li>\r\n<li>Accept open donations from your users instead of charging a fixed price</li>\r\n</ul>\r\n<h2>Track your stats</h2>\r\n<ul>\r\n<li>Assign unique tracking codes to different sources</li>\r\n<li>Reporting on sales from attendee</li>\r\n<li>Facebook and Twitter shares along with daily page views and sales</li>\r\n</ul>', 1, '', 'YES', NULL, NULL, 'manage', 0, 0, 0, 0, '2013-04-16 00:02:43', '2013-05-04 08:54:54'),
(23, 0, 'Press', '<p><span>Eventbriteclone enables people all over the world to plan, promote, and sell out any event&mdash;from photography and yoga classes, to sold out concerts and festivals. We believe that gathering with others is the best way for people to learn, grow, get inspired, feel connected, give back, and celebrate. So we''re building technology that facilitates those gatherings. In this way, Eventbriteclone brings communities together through live experiences.</span></p>', 1, NULL, 'YES', NULL, NULL, 'press', 0, 0, 0, 1, '2013-04-16 00:02:43', '2013-05-04 09:06:58'),
(24, 0, 'Careers', '<h3>Join a team of passionate, driven, creative, and fun-loving people. Together we''ll change the way people get out there and get together.</h3>\r\n<p>&nbsp;</p>\r\n<p><span>Working at Eventbriteclone means being part of a community. From biking together to breakfast, to team outings at the trampoline park, the Britelings have fun in and outside of the office. That''s why we''ve been selected as one of the Best Places to Work in the Bay Area!</span></p>\r\n<p><span><span>We''re only as good as we feel. So we keep the Britelings vibrant with a monthly stipend to cover whatever they do to find optimal health &amp; wellness, along with the time off you need to recharge to unwind, and regular group exercise opportunities.</span></span></p>', 1, NULL, 'YES', NULL, NULL, 'careers', 0, 0, 0, 1, '2013-04-16 00:02:43', '2013-05-04 09:09:36'),
(25, 0, 'Blog', '', 1, NULL, 'YES', NULL, NULL, 'blog', 0, 0, 0, 1, '2013-04-16 00:02:43', '2013-07-08 12:18:41'),
