ior permission.&nbsp; Deep linking (i.e. links to Event Shack Ltd specific pages within the site) requires the express permission of Event Shack Ltd.&nbsp; To find out more please contact us by email at support@eventshack.com.</p>\r\n\r\n<p>8. Use of Communications Facilities</p>\r\n\r\n<p>8.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When using the enquiry form or any other System on the Website you should do so in accordance with the following rules:</p>\r\n\r\n<p>8.1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not use obscene or vulgar language;</p>\r\n\r\n<p>8.1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not submit Content that is unlawful or otherwise objectionable.&nbsp; This includes, but is not limited to, Content that is abusive, threatening, harassing, defamatory, ageist, sexist or racist;</p>\r\n\r\n<p>8.1.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not submit Content that is intended to promote or incite violence;</p>\r\n\r\n<p>8.1.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is advised that submissions are made using the English language as we may be unable to respond to enquiries submitted in any other languages;</p>\r\n\r\n<p>8.1.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The means by which you identify yourself must not violate these Terms and Conditions or any applicable laws;</p>\r\n\r\n<p>8.1.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not impersonate other people, particularly employees and representatives of Event Shack Ltd or our affiliates; and</p>\r\n\r\n<p>8.1.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not use our System for unauthorised mass-communication such as &ldquo;spam&rdquo; or &ldquo;junk mail&rdquo;.</p>\r\n\r\n<p>8.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You acknowledge that Event Shack Ltd reserves the right to monitor any and all communications made to us or using our System.</p>\r\n\r\n<p>8.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You acknowledge that Event Shack Ltd may retain copies of any and all communications made to us or using our System.</p>\r\n\r\n<p>8.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You acknowledge that any information you send to us through our System may be modified by us in any way and you hereby waive your moral right to be identified as the author of such information.&nbsp; Any restrictions you may wish to place upon our use of such information must be communicated to us in advance and we reserve the right to reject such terms and associated information.</p>\r\n\r\n<p>9. Accounts</p>\r\n\r\n<p>9.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In order to procure Services on this Website and to use the facilities you are required to create an Account which will contain certain personal details and Payment Information which may vary based upon your use of the Website as we may not require payment information until you wish to make a purchase.&nbsp; By continuing to use this Website you represent and warrant that:</p>\r\n\r\n<p>9.1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; all information you submit is accurate and truthful;</p>\r\n\r\n<p>9.1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; you have permission to submit Payment Information where permission may be required; and</p>\r\n\r\n<p>9.1.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; you will keep this information accurate and up-to-date.</p>\r\n\r\n<p>Your creation of an Account is further affirmation of your representation and warranty.</p>\r\n\r\n<p>9.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is recommended that you do not share your Account details, particularly your username and password.&nbsp; Event Shack Ltd accepts no liability for any losses or damages incurred as a result of your Account details being shared by you.&nbsp; If you use a shared computer, it is recommended that you do not save your Account details in your internet browser.</p>\r\n\r\n<p>9.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you have reason to believe that your Account