INSERT INTO `tips` (`id`, `tip_type`, `title`, `desc`, `created_at`, `updated_at`) VALUES
(1, 'Expert Tip', 'Expert Tips', '<h3><br></h3><h3><b>Put your best event page :</b></h3>\r\n            <p>Increase attendance by giving a clear understanding\r\n of what to expect at your event.</p>\r\n            \r\n\r\n            <h3><br></h3><h3><b>Give the details:</b></h3>\r\n            <p>People are more likely to attend your event if they have \r\nall the info.\r\n Don''t forget to add <br></p><p>your contact email and phone number!</p>\r\n\r\n            <h3><br></h3><h3><b>Repeating events :</b><br></h3>\r\n            <p>Is your event taking place on more than one date? Use our\r\n repeating events feature, <br></p><p>or create multiple events and direct \r\nattendees to your organizer profile page.</p><h3><br>\r\n\r\n            </h3><h3><b>For more detailed information, visit our Help Center.</b></h3><br>', '2013-05-16 11:22:32', '2013-05-16 11:22:32'),
(2, 'Ticket Tip', 'Ticket Tips', '<h2><br></h2><br><div>\r\n        \r\n\r\n            <h3><b>Free for free events</b></h3>\r\n            <p>Did you know it''s free to use Eventshack for free events?\r\n That''s right, free tickets will <br></p><p>never be charged a fee. For paid \r\nevents, you can choose to pass along the fee to your</p><p> attendees or \r\ninclude it in the ticket price.</p><h2><br></h2><h3><b>Have limited space?</b></h3>\r\n            <p>You can set an overall capacity for your event so that you never exceed your space.</p></div><br>', '2013-05-16 11:23:58', '2013-10-24 07:59:39'),
(3, 'Promote Tip', 'Promote Tips', '<h3><br></h3><h3><b>Personalize your event web address</b></h3>\r\n            <p>You can make an event URL more memorable by giving it a \r\ncustomized web address <br></p><p>that is related to the event title or your \r\norganization.</p><br>', '2013-05-16 11:25:16', '2013-05-16 11:25:16');
